export default {
    name: 'Parallax',
    data() {
        return {
            hasParallax: true,
            layers: [
                { hasParallax: false , dataSpeed: 85 },
                { hasParallax: true , dataSpeed: 65 },
                { hasParallax: true , dataSpeed: 50 },
